import React from 'react';
import CalculateForm from "./calculateForm";
import {connect} from "react-redux";
import {
    updateTextComment, updateTextHeight, updateTextLenght,
    updateTextQuantity,
    updateTextType,
    updateTextWeight, updateTextWidth
} from "../../../../redux/calculateFormReducer";

class CalculateFormContainer extends React.Component{
    render() {
        return <CalculateForm {...this.state}/>
    }
}
let mapStateToProps=(state)=>{
    return {
        calculateForm:state.CalculateFormPage
    }
}
const CalculateFormContainerExport = connect(mapStateToProps,{updateTextType,updateTextQuantity,updateTextComment,updateTextWeight,updateTextWidth,updateTextHeight,updateTextLenght})(CalculateFormContainer);
export default CalculateFormContainerExport;
